/**
 * Distinguished Name (DN) X.500.
 * @property {string} CN (Common Name): Nome Comum.
 * @property {string[]} OU (Organizational Units): Unidades Organizacionais.
 * @property {string} O (Organization): Organização.
 * @property {string} L (Locality): Localidade.
 * @property {string} ST (State): Estado.
 * @property {string} C (Country): País.
 * @property {string} E (E-mail): E-mail.
 */
export default interface X500DistinguishedName {
    CN?: string;
    OU?: string[];
    O?: string;
    L?: string;
    ST?: string;
    C?: string;
    E?: string;
}
